# print("this is a debug message")

def solution(A, B):
    for n in (A[0], B[0]):
        indicator = True
        for i in range(len(A)):
            if A[i] != n and B[i] != n:
                indicator = False
                break
        if indicator:
            return min(len(A) - A.count(n), len(B) - B.count(n))
    return -1


if __name__ == '__main__':
    print(solution([3,5,1,2,3], [3,6,3,3,4]))




